import React, {useEffect, useState} from 'react';


const ApiService = () => {

    const [yes, setYes] = useState();

    useEffect(() => {
        const fetchData = async () => {
            try {
                fetch('http://localhost:5000', {
                        method: 'GET',
                        credentials: 'include',
                      }).then((response) => {
                        if (!response.ok){
                            console.log("There is no data")
                        }
                        return response.json();
                      })
                      .then((data) => {
                        console.log(data)
                        setYes(data)
                      })

            } catch (error) {
                console.error('cant get data after search & login', error);
              }

    }
    })

    return ( <div className='text'>
   {yes ? (
        <div>{JSON.stringify(yes)}</div>) : (<div>Loading...</div>)}</div>);






}


export default ApiService
